      </Routes>
    </Router>
      {/* <FrontPage/> */}
      {/* <StepForm/> */}
      {/* <NewBusiness/> */}
      {/* <ExistBusinessInfo/> */}
      {/* <ExistingBusiness/> */}
      {/* <OwnerInfo/> */}
    </>
  );
}

export default App;
